  false,\n\t\"url\": null,\n\t\"notes\": \"This supplement is prepared in compliance
  with instructions included in 2d endorsement ENGCW-EZ dated 9 June 1965 to the transmittal
  letter for Design Memorandum No. 1, General, Lock and Dam No. 9, Arkansas River
  and Tributaries.  It includes an evaluation of the effects of the Arkansas River
  plan on the Holla Bend National Wildlife Refuge operated by the U.S. Fish and Wildlife
  Service; a recommended plan for mitigating wildlife loses attributable to the Arkansas
  River plan; alternative plans considered for mitigating the wildlife losses; and
  design criteria, economic evaluation, and a construction schedule for the proposed
  construction.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
